INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 1, 122601, 1, 1, 0, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0, 105, 0.029, 160, 1.5, 1, 101);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 0, 122401, 3, 2, 1, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0, 111, 0.014, 120, 2.5, 2, 102);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 122501, 2, 3, 0, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 1, 105, 0.017, 350, 2.5, 3, 103);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 107501, 3, 4, 1, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0, 105, 0.016, 130, 1.5, 4, 104);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 1, 107601, 1, 5, 0, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0, 105, 0.014, 160, 2.5, 5, 105);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (120, 0, 107801, 2, 6, 0, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 1, 103, 0.029, 255, 3.5, 6, 106);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (120, 1, 110601, 1, 7, 0, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0, 103, 0.013, 160, 3.5, 7, 107);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 110401, 2, 8, 0, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 1, 103, 0.014, 350, 2.5, 8, 108);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 0, 110501, 3, 9, 1, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0, 100, 0.012, 130, 1.5, 9, 109);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 1, 115701, 1, 10, 0, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0, 103, 0.014, 200, 2.5, 10, 110);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 0, 113601, 2, 11, 0, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 1, 103, 0.071, 350, 2.5, 11, 111);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (120, 0, 107901, 3, 12, 1, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0, 103, 0.014, 130, 1.5, 12, 112);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 1, 108001, 2, 13, 0, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0, 105, 0.022, 200, 1.5, 13, 113);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 1, 110301, 1, 14, 0, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0, 108, 0.031, 160, 2.5, 14, 114);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 107701, 1, 15, 1, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0, 105, 0.036, 130, 0.5, 15, 115);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 113101, 2, 16, 0, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 1, 95, 0.048, 350, 3.5, 16, 116);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 0, 113301, 3, 17, 1, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0, 105, 0.043, 130, 1.5, 17, 117);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 0, 113201, 2, 18, 1, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0, 95, 0.018, 130, 1.5, 18, 118);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 1, 117001, 2, 19, 0, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0, 108, 0.021, 160, 2.5, 19, 119);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 113501, 1, 20, 0, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 1, 105, 0.036, 255, 2.5, 20, 120);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 0, 113401, 3, 21, 0, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 1, 105, 0.02, 350, 2.5, 21, 121);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 110101, 1, 22, 1, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0, 105, 0.018, 130, 2.5, 22, 122);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 1, 110001, 3, 23, 0, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0, 111, 0.03, 160, 3.5, 23, 123);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 117201, 1, 24, 1, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0, 103, 0.027, 130, 1.5, 24, 124);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 1, 117301, 2, 25, 0, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0, 108, 0.02, 160, 3.5, 25, 125);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 117401, 3, 26, 0, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 1, 105, 0.04, 350, 2.5, 26, 126);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 117101, 1, 27, 0, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 1, 105, 0.009, 350, 3.5, 27, 127);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (120, 0, 122901, 1, 28, 0, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 1, 105, 0.022, 255, 3.5, 28, 128);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (110, 0, 122801, 3, 29, 1, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0, 105, 0.028, 130, 2.5, 29, 129);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (105, 1, 122701, 2, 30, 0, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0, 108, 0.023, 130, 3.5, 30, 130);
